import React from "react";

const MorePanel = () => {
  return (
    <div className="more-panel">
      <div className="more-panel__item">
        <div className="more-panel__item__icon">
          <i className="fas fa-cog"></i>
        </div>
        <div className="more-panel__item__text">Settings</div>
      </div>
    </div>
  );
};

export default MorePanel;
